Album::ApprovalStatusEnum Album::toApprovalStatusEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("PENDING")) {
        return ApprovalStatusEnum::PENDING;
    }
    
    if (value == utility::conversions::to_string_t("REJECTED")) {
        return ApprovalStatusEnum::REJECTED;
    }
    
    if (value == utility::conversions::to_string_t("APPROVED")) {
        return ApprovalStatusEnum::APPROVED;
    }
    
    if (value == utility::conversions::to_string_t("FEATURED")) {
        return ApprovalStatusEnum::FEATURED;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ApprovalStatusEnum");
}


const utility::string_t Album::fromApprovalStatusEnum(const ApprovalStatusEnum value) const
{
    switch(value)
    {
        
        case ApprovalStatusEnum::PENDING: return utility::conversions::to_string_t("PENDING");
        
        case ApprovalStatusEnum::REJECTED: return utility::conversions::to_string_t("REJECTED");
        
        case ApprovalStatusEnum::APPROVED: return utility::conversions::to_string_t("APPROVED");
        
        case ApprovalStatusEnum::FEATURED: return utility::conversions::to_string_t("FEATURED");
        
    }
}

